  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Sabine NWR outlines
  Refuge accomplishments from January through April of 1943. The report begins by
  summarizing the weather conditions during this period. Wildlife- including migratory
  birds, upland game birds, and big game animals- is also covered. The Refuge development
  and maintenance section discusses physical developments. Resource management is
  outlined; topics include grazing and fur harvesting. The public relations section
  of the report describes Refuge visitors, Refuge participation, fishing, and violations.
  N-R forms are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
